import Grid from '@material-ui/core/Grid';
import React from 'react';
import {StyleSheet, View} from 'react-native';
import CardDisplayV from './cards';
import HeaderV from './Header';
import LineChartV from './LineChart';
import NavbarV from './Navbar';

const Mystyle={
  backgroundColor:{
    backgroundColor:'#eee'
  },
  chartstyle:{
    backgroundColor:'white',
    margin:'10px',
    borderRadius:'5px',
    padding:'10px',
    boxShadow: '2px 2px #ccc'
  }
}

const cardData=[{
  header:"01.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
},
{
  header:"02.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
},
{
  header:"03.",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
},
{
  icon:"https://img.icons8.com/color/search",
  title:"Optimize Processing",
  description:"Simplify and automate student registration and certification."
}];

// const styles = {
//   titleStyle:{
//   color:'orange',
//   display:'flex',
//   alignItem:'center',
//   justifyContent: 'center',
//   textTransform: 'uppercase',
//   fontSize:'20px',
//   fontWeight: 'bold',
//   marginBottom: '0px'
//   }
// };

const titleStyles={
    color:'orange',
    display:'flex',
    alignItem:'center',
    justifyContent: 'center',
    textTransform: 'uppercase',
    fontSize:'45px',
    fontWeight: 'bold',
    marginBottom: '10px'
};

const subtitleStyles={
  display:'flex',
  alignItem:'center',
  justifyContent: 'center',
  textAlign:'center',
  fontWeight:'300',
  fontSize:'22px',
  marginLeft:'250px',
  marginRight:'250px',
  marginBottom:'40px'
}

const ContentHeaderStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'900',
  color:'orange',
  fontSize:'80px',
  marginTop:'5px',
}

const ContentTitleStyles={
  display:'flex',
  fontWeight:'800',
  color:'black',
  textTransform: 'uppercase',
  fontSize:'20px',
  marginTop:'10px',
}

const ContentIconStyles={
  width:'100px',
  height:'100px'
}

const ContentDescriptionStyles={
  display:'flex',
  fontWeight:'300',
  fontSize:'20px',
  marginTop:'10px',
}





function DashboardV() {
  return (
    <View style={StyleSheet.flatten([Mystyle.backgroundColor])}>

      <HeaderV/>

      <Grid container  >
        <Grid item xs={12} sm={9} md={1}>
        <Grid item xs={12} sm={9} md={3} >
        <NavbarV/>
        </Grid>
        </Grid>
        <Grid container >
        <Grid item xs={11} sm={9} md={12} style={StyleSheet.flatten([Mystyle.chartstyle])}>
        <CardDisplayV
        title={"WE BRING THE BEST THINGS"}
        description={"Embrace a blockchain-powered platform to issue digital certificates, manage training batches, and simplify placement processes."}
        titleStyles={titleStyles}
        subtitleStyles={subtitleStyles}
        cardData={cardData}
        ContentHeaderStyles={ContentHeaderStyles}
        ContentTitleStyles={ContentTitleStyles}
        ContentIconStyles={ContentIconStyles}
        ContentDescriptionStyles={ContentDescriptionStyles}/>
      </Grid>
</Grid>


        <Grid item xs={12} sm={9} md={9}>
        <Grid container >
        <Grid item xs={11} sm={9} md={12} style={StyleSheet.flatten([Mystyle.chartstyle])}>
      <LineChartV/>
      </Grid>


     </Grid>



      </Grid>


          </Grid>

</View>


  );
}

export default DashboardV;
